import React from "react";

function DataTable({ users }) {
  return (
    <div>
      <thead>
        <tr>
          <th>Employee</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Email</th>
        </tr>
      </thead>
      <tbody>
          {users.map(({ login, name, picture, phone, email }) => { 
              return (
                  <tr key={login.uuid}>
                      <td className="align-middle">
                          <img src={picture.thumbnail}/>
                      </td>

                  </tr>
              )

          })}
      </tbody>
    </div>
  );
}

export default DataTable;
